sources.style/header.scss:
.header {
  width: 100%;
  height: 100vh;

  // background: $lightBlue url(../img/header_fon.jpg) no-repeat center;
  // background-size: cover;
  background: linear-gradient(45deg, #f17c58, #e94584, #24aadb, #27dbb1, #ffdc18, #ff3706);
  background-size: 600% 100%;
  animation: gradient 16s linear infinite;
  animation-direction: alternate;

  font-family: 'Alice', serif;
  .menu {
    font-family: 'PT Sans Caption', sans-serif;
    position: fixed;
    width: 100%;
    z-index: 1;

    a:visited,
    a:link,
    a {
      color: white;
      text-decoration: none;
      transition: 0.3s;
    }

    .phone_menu {
      transform: translateY(-150vh);
      transition: 1s;
      display: flex;
      position: fixed;
      bottom: 0px;
      height: calc(100vh - 70px);
      width: 250px;
      flex-direction: column;
      justify-content: space-between;
      padding-left: 30px;

      background-image: linear-gradient($darkBlue-opacity_2 0%, rgba(6, 0, 41, 0.9));

      @extend %font_large;

      .phone_list {
        display: flex;
        flex-direction: column;
        overflow: scroll;
        margin-top: 50px;
        border-left: 1px solid $lightBlue;

        @media screen and (max-height: 650px) {
          margin-top: 20px;
          font-size: 20px;
        }

        @media screen and (max-height: 550px) {
          margin-top: 10px;
          font-size: 16px;
          .phone_list_item {
            margin-bottom: 0px;
          }
        }

        .phone_list_item {
          padding: 10px;
          margin-bottom: 10px;
          border-bottom-width: 2px;
          border-style: solid;
          border-color: transparent;
        }

        .phone_list_item:hover {
          border-color: $lightBlue;
        }

        #phone_btn_order a {
          color: orange;
        }
      }

      .phone_social_list {
        display: flex;
        flex-direction: row;
        justify-content: start;
        margin-bottom: 40px;

        li {
          padding: 0px 10px;
        }
        li a:hover {
          color: $lightBlue;
        }
      }
    }
    @media screen and (max-width: 1075px) {
      .phone_menu_active {
        transform: translateY(0);
      }
    }

    .menu_list {
      height: 70px;
      background-image: linear-gradient($darkBlue-opacity_6, $darkBlue-opacity_2);
      width: 100%;
      max-width: 1440px;
      margin: auto;
      display: flex;
      flex-direction: row;
      justify-content: space-between;
      align-items: center;
      padding: 0px 20px;

      .btn_phone_menu {
        display: none;
        transition: 0.4s;
        cursor: pointer;
        position: fixed;
        transform: translate(-50%, -50%);
        top: 35px;
        left: 35px;

        .bar1,
        .bar2,
        .bar3 {
          width: 28px;
          height: 3px;
          background-color: white;
          margin: 5px 0;
        }

        @media screen and (max-width: 1075px) {
          display: inline-block;
        }
      }
      .btn_phone_menu_active {
        z-index: 101;
        position: fixed;

        .bar1 {
          transform: rotate(-45deg) translate(-4px, 4px);
        }

        .bar2 {
          opacity: 0;
        }

        .bar3 {
          transform: rotate(45deg) translate(-6px, -7px);
        }
      }

      #logo {
        img {
          width: 70px;
        }
        @media screen and (max-width: 1075px) {
          position: absolute;
          right: 20px;
        }
      }

      .item_desktop_menu {
        display: flex;
        flex-direction: row;
        text-transform: uppercase;
        li {
          margin: 0px 20px;
        }
        li a:hover {
          color: $lightBlue;
        }
        @media screen and (max-width: 1075px) {
          display: none;
        }
      }

      .menu_social_item {
        display: flex;
        flex-direction: row;
        position: relative;
        right: 40px;

        li {
          margin: 0px 2px;
          height: 30px;
          font-size: 22px;
          width: 30px;
          background-color: white;
          border-radius: 50%;
          text-align: center;
          line-height: 32px;

          a:visited,
          a:link,
          a {
            color: black;
          }
        }
        li:hover {
          background-color: $darkBlue-opacity_6;
        }
        li:hover a {
          color: $lightBlue;
        }

        @media screen and (max-width: 1075px) {
          display: none;
        }
      }
    }
    @keyframes forNavBtn {
      0% {
        transform: rotate(0deg);
      }
      85% {
        transform: rotate(0deg);
        right: 20px;
      }
      88% {
        transform: rotate(30deg);
        right: 30px;
      }
      91% {
        transform: rotate(-20deg);
      }
      94% {
        transform: rotate(10deg);
      }
      97% {
        transform: rotate(-5deg);
        right: 20px;
      }
      100% {
        transform: rotate(0deg);
      }
    }

    #btn_order,
    #btn_ask {
      animation: forNavBtn 4s linear 0s infinite;
      display: block;
      position: fixed;
      height: 50px;
      width: 50px;
      text-align: center;
      @extend %font_large;
      color: black;
      text-shadow: 0px 0px 10px rgba(255, 255, 255, 0.5);
      line-height: 50px;
      border-radius: 50%;
      right: 20px;
      bottom: 110px;
      background-color: rgba(255, 196, 0, 0.9);
      box-shadow: 0px 0px 10px -4px black;
    }
    #btn_order:hover::after,
    #btn_ask:hover::after {
      cursor: pointer;
      content: 'Gets or sets whether the text layout grid uses two dimensions.';
      display: block;
      position: relative;
      line-height: 14px;
      border: 1px solid orange;
      color: black;
      padding: 30px;
      border-radius: 50px;
      border-bottom-right-radius: 0px;
      width: min-content;
      left: -110px;
      bottom: 190px;

      font-size: 12px;
      background-color: white;
    }

    #btn_ask:hover::after {
      content: 'Gets or sets whether the text layout grid uses two dimensions.';
      border: 1px solid $lightBlue;
    }

    #btn_order:hover,
    #btn_ask:hover {
      background-color: $darkBlue;
      animation: none;
    }
    #btn_ask:hover {
      color: $lightBlue_opacity_9;
    }
    #btn_order:hover {
      color: rgba(255, 196, 0);
    }
    #btn_ask {
      bottom: 40px;
      background-color: $lightBlue;
    }
  }
  .header_content {
    font-family: 'EB Garamond', serif;
    height: 100%;
    padding: 40vh 50px 50px;

    text-align: center;
    @extend %font_extralarge;
    text-shadow: 0px 0px 10px black;
    p {
      @extend %font_normal;
    }
    #btn_learn_detailed {
      cursor: pointer;
      font-size: 18px;
      position: absolute;
      bottom: 30px;
      left: calc(50% - 74px);
      border-bottom: 1px solid transparent;
      color: $lightBlue;
    }
    #btn_learn_detailed:hover {
      border-bottom: 1px solid $lightBlue;
    }
  }
}

sources.style/section.scss:
section {
  width: 100%;
  padding: 10vh 0px;

  @media screen and (max-width: 550px) {
    padding: 5vh 0px;
  }

  > div {
    width: 100%;
    max-width: 1440px;
    margin: auto;
    display: flex;
    flex-direction: row;
    vertical-align: middle;
    justify-content: space-around;

    @media screen and (max-width: 550px) {
      flex-direction: column;
    }

    > div {
      width: 50%;
      padding-left: 20px;
      font-family: 'PT Sans Caption';

      h2 {
        font-size: 32px;
        line-height: 60px;
        margin-left: 20px;
      }
      h3 {
        font-size: 28px;
        line-height: 42px;
        margin-left: 20px;
      }
      h4 {
        font-size: 20px;
        line-height: 32px;
      }
      p {
        font-size: 18px;
        line-height: 28px;
        text-shadow: 0px 0px 1px white;
      }

      ul {
        list-style-type: circle;
        margin-left: 20px;
        li {
          font-size: 20px;
          line-height: 1.1;
          line-height: 32px;
        }
      }
    }

    // .description_img {
    // }
  }
}
.description {
  background-image: linear-gradient(90deg, rgba(255, 255, 255, 0.1), transparent),
    url(../img/description_img.jpg);
  background-color: white;
  background-position: 110% 50%;
  background-repeat: no-repeat;
  background-size: 65%;

  > div {
    justify-content: start;
    > div {
      width: 50%;
    }
  }

  @media screen and (max-width: 750px) {
    background-position: 100% 100%;
    background-size: 75%;

    > div {
      > div {
        width: 100%;
      }
    }
  }

  p {
    margin-bottom: 50px;
    margin-right: 100px;
  }

  @media screen and (max-width: 650px) {
    background-position: 50% 57%;
    background-size: 80%;
    padding: 5vh 0px;

    p {
      margin-bottom: 300px;
    }
  }
  @media screen and (max-width: 500px) {
    background-size: 100%;

    p {
      margin-bottom: 400px;
      margin-right: 0px;
    }
  }
  @media screen and (max-width: 500px) {
    background-position: 50% 62%;
    background-size: 105%;

    p {
      margin-bottom: 300px;
    }
  }
}

.specifications {
  background-color: $lightBlue;
  background-position: -20% 50%;
  background-repeat: no-repeat;
  background-size: 70%;

  .specifications_img {
    border: 1px solid white;
    height: 80vh;
    margin-left: 20px;

    .specifications_bar {
      display: flex;
      flex-direction: row;
      flex-wrap: wrap;
      position: absolute;
      bottom: 0px;
      left: 0px;

      li {
        width: 40px;
        height: 40px;
      }
    }
  }

  @media screen and (max-width: 550px) {
    .specifications_img {
      order: -1;
      height: 45vh;
      width: 100%;
      margin: 0px;
      background: rgb(119, 92, 170);

      .specifications_bar {
        height: 100%;
        flex-direction: column;
        top: 0px;
        left: -20px;
      }
    }
    > div {
      > div {
        width: 100%;
        padding: 0px;
      }
    }
  }

  ul {
    list-style: none;
    margin-left: 20px;
    padding: 5px;
    padding-bottom: 10px;
    > ul {
      margin-left: 40px;
    }
    li {
      padding: 5px;
      font-size: 16px;
      line-height: 22px;
      border: 1px solid rgba(255, 255, 255, 0.4);
      border-right: 1px solid transparent;
      border-bottom: 1px solid transparent;

      big {
        color: rgb(255, 200, 0);
      }
    }
    > li:hover {
      border: 1px solid rgba(255, 255, 255, 0.8);
      border-right: 1px solid transparent;
      border-bottom: 1px solid transparent;
    }
  }
  @media screen and (max-width: 700px) {
    > div {
      > div {
        padding: 0px;
      }
    }
    ul {
      padding: 0px;
    }
  }
}

.accessories {
  > div {
    > div {
      padding-left: 0px;
    }
  }

  ul {
    list-style: none;
    padding: 5px;
    padding-bottom: 10px;
    > ul {
      margin-left: 40px;
    }
    li {
      padding: 5px;
      font-size: 16px;
      line-height: 22px;
      border: 1px solid rgb(0, 191, 255);
      border-left: 1px solid transparent;
      border-bottom: 1px solid transparent;

      h4 {
        color: rgb(255, 200, 0);
      }
    }
    > li:hover {
      border: 1px solid rgb(0, 5, 80);
      border-left: 1px solid transparent;
      border-bottom: 1px solid transparent;
    }
  }
  .accessories_img {
    border: 1px solid rgb(0, 191, 255);
    height: 80vh;
    margin: 0px 10px;

    .accessories_bar {
      display: flex;
      flex-direction: row;
      flex-wrap: wrap;
      position: absolute;
      bottom: 0px;
      left: 0px;

      li {
        width: 40px;
        height: 40px;
      }
    }
  }
  @media screen and (max-width: 550px) {
    .accessories_img {
      background: rgb(102, 102, 211);
      margin: 0px;
      height: 45vh;
      order: -1;

      .accessories_bar {
        flex-direction: column;
        top: 0px;
        left: -20px;
      }
    }
    > div {
      > div {
        width: 100%;
        padding: 0px;
      }
    }
  }
}

.question {
  background-color: $lightBlue;
  vertical-align: middle;
  align-items: center;
  padding: 100px 0px;
  text-align: center;

  div {
    width: 100%;
    margin: auto;

    div {
      padding: 0px 200px;
      @media screen and (max-width: 850px) {
        padding: 0px 100px;
      }
      @media screen and (max-width: 600px) {
        padding: 0px;
      }

      h2 {
        line-height: 40px;
        margin-bottom: 50px;
        margin-left: 0px;
      }

      input {
        margin: 5px;
        border: 1px solid $darkBlue;
        background-color: $lightBlue;
        overflow: hidden;
        padding: 20px;
        font-size: 16px;
      }

      input:hover {
        border: 1px solid rgb(111, 219, 255);
      }

      input:focus {
        border: 1px solid orange;
      }

      input[type='submit'] {
        color: rgb(9, 56, 71);
        cursor: pointer;
        margin: 30px 30%;
      }
    }
  }
}

footer {
  position: relative;
  padding: 50px 0px;
  background-color: $darkBlue;
  color: white;

  > div {
    margin: auto;
    width: 100%;
    max-width: 1440px;
    display: flex;
    flex-direction: row;
    vertical-align: middle;
    justify-content: space-around;

    @media screen and (max-width: 430px) {
      flex-direction: column;
    }

    > div {
      width: 50%;
      font-family: 'PT Sans Caption';
      display: flex;
      justify-content: center;
      padding: 0px 30px;
    }
  }
  .footer_sign {
    font-size: 12px;
    position: absolute;
    bottom: 10px;
  }
  .footer_social_list {
    display: flex;
    flex-direction: column;
    font-size: 30px;
    justify-content: center;

    @media screen and (max-width: 430px) {
      flex-direction: row;
      padding: 20px 0px;
    }

    li {
      padding: 0px 10px;
      a {
        color: white;
      }
    }
    li a:hover {
      color: $lightBlue;
    }
  }
}

sources.style/form_buy.scss:
.section_buy_closse {
  display: none;
}

.section_buy {
  position: fixed;
  top: 0px;
  width: 100%;
  height: 100vh;
  z-index: 100;
  background-color: $darkBlue-opacity_6;
  overflow-y: scroll;

  > div {
    position: relative;
    background-color: #ffffff;
    width: max-content;
    margin: auto;
    padding: 0px;
    color: $darkBlue;
    font-family: 'PT Sans Caption';
    line-height: 26px;
    border: 1px solid orange;

    background: linear-gradient(45deg, #0084ff, #24aadb, #27dbb1, #ffdc18);
    background-size: 600% 100%;
    animation: gradient 16s linear infinite;
    animation-direction: alternate;
  }
  @media screen and (max-width: 500px) {
    width: 90%;
  }

  // @media screen and (min-width: 1440px) {
  //   width: 1000px;
  //   margin: 10vh auto 0px;
  // }

  .form_buy_btn_closse {
    position: absolute;
    right: 10px;
    top: 10px;
    font-size: 30px;
    border: none;
    font-weight: 900;
    background-color: transparent;
    padding: 0px;
  }

  .form_buy_btn_closse:hover {
    color: orange;
  }

  .block_thanks {
    display: none;
  }
  form {
    margin: 50px;
    display: flex;
    flex-direction: column;

    input {
      display: inline-block;
      width: min-content;
      padding: 10px 20px;
      margin: 5px;
      border: 1px solid $lightBlue;
      background-color: #e8f0fe;
      font-size: 16px;
    }
    input:hover {
      border-color: $darkBlue;
    }
    input:focus {
      border-color: orange;
    }

    #form_buy_btn_submit {
      margin-top: 20px;
      background: #162138;
      border-color: orange;
      color: orange;
      box-shadow: 0px 0px 10px -2px #162138;
    }
    #form_buy_btn_submit:hover {
      background: orange;
      border-color: #162138;
      color: #162138;
    }
    #form_buy_btn_submit:active {
      box-shadow: 0px 0px 10px -2px #162138 inset;
      font-size: 15px;
    }
  }
}
